import React, { Component } from 'react';

export default class Body extends Component {
  constructor(props) {
    super(props);
    this.state = { content: 'Product Page' };
  }

  showProduct = () => {
    this.setState({ content: 'Product Page' });
  };

  showCustomer = () => {
    this.setState({ content: 'Customer Page' });
  };

  render() {
    return (
      <div>
        <nav>
          <button onClick={this.showProduct}>Product</button>
          <button onClick={this.showCustomer}>Customer</button>
        </nav>
        <div>{this.state.content}</div>
      </div>
    );
  }
}
